import React from "react";

const Cservice = ({ serviceApi }) => {
  return (
    <div className="box-container">
      {serviceApi.map((e) => {
        <div className="box">
          <i className="fas fa-code"></i>
          <h3>web design</h3>
          <p>
            Lorem ipsum dolor, sit amet consectetur adipisicing elit. Maiores,
            quidem.
          </p>
        </div>;
      })}
    </div>
  );
};

export default Cservice;
